// CONTACT_ELEMENT_TRIM
// 


 ATTRIBUTES(COMMON) 
 
 {
  
  // Initial and reference densities
  KEYWORD_STR                     = VALUE(STRING, "Solver Keyword");
  LSD_PSID                        = VALUE(SETS, "Part Set") { SUBTYPES = (/SETS/SET_PART_IDPOOL) ; }
}

SKEYWORDS_IDENTIFIER(COMMON)

{

 KEYWORD_STR                 = 9000;
LSD_PSID                     = 768;

}


GUI(COMMON) 

{


    ASSIGN(KEYWORD_STR, "*ELEMENT_TRIM");
    
    DATA(LSD_PSID);

    
}

// File format
FORMAT(Keyword971) {

COMMENT("$     PSID");
CARD("%10d",LSD_PSID);

}
